import React, {Component} from "react";


import TradingViewWidget, { Themes } from 'react-tradingview-widget';
 
const LiveCharts = () => (
  <TradingViewWidget
    symbol="NASDAQ:AAPL"
    theme={Themes.DARK}
    locale="fr"
    size={{width:'900', height:'900'}}
  />
);

export default LiveCharts;
